// utils/pdfGenerator.js
import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";

pdfMake.vfs = pdfFonts.pdfMake ? pdfFonts.pdfMake.vfs : pdfFonts.vfs;

export const generateServicePDF = (service) => {
  const formatPrice = (amount) =>
    `CRC ${Number(amount || 0).toLocaleString("es-CR", {
      minimumFractionDigits: 2,
    })}`;

  const subtotal = Number(service.total_price || 0);
  const iva = Number((subtotal * 0.13).toFixed(2));
  const total = Number((subtotal + iva).toFixed(2));

  const docDefinition = {
    content: [
      // Logo centrado en la parte superior
      {
        image:
          "data:image/png;base64,",
        width: 300,
        alignment: "center",
        margin: [0, 0, 0, 10],
      },
      {
        text: `Nmero de orden: ${service.order_number}` || "No disponible",
        style: "header",
      },
      {
        text: `Estado: ${service.status_service.name}` || "No disponible",
        style: "subheader",
      },

      { text: "Informacin General", style: "sectionHeader" },
      {
        table: {
          widths: ["auto", "*"],
          body: [
            [
              "Fecha de ingreso:",
              `${service.entry_date} a las ${service.entry_time}` ||
                "No disponible",
            ],
            [
              "Nombre del cliente:",
              `${service.client.name || ""} ${service.client.lastname1 || ""} ${
                service.client.lastname2 || ""
              }`.trim() || "No disponible",
            ],
            ["Marca:", service.vehicle.brand || "No disponible"],
            ["Placa:", service.vehicle.plate || "No disponible"],
            [
              "Kilometraje:",
              service.vehicle.mileage
                ? `${Number(service.vehicle.mileage).toLocaleString(
                    "es-CR"
                  )} km`
                : "No disponible",
            ],
            [
              "Encargado de flotilla:",
              service.fleetUser
                ? `${service.fleetUser.name} ${service.fleetUser.lastname1}`.trim()
                : "No disponible",
            ],
            [
              "Encargado de taller:",
              service.assigned_to
                ? `${service.assigned_to.name} ${service.assigned_to.lastname1}`.trim()
                : "No disponible",
            ],
            [
              "Mecnico:",
              service.mechanics && service.mechanics.length > 0
                ? service.mechanics.join(", ")
                : "No disponible",
            ],
            [
              "Recibido por:",
              `${service.received_by.name} ${service.received_by.lastname1}` ||
                "No disponible",
            ],
          ],
        },
        layout: "lightHorizontalLines",
        margin: [0, 0, 0, 10],
      },

      service.observations && service.observations.trim() !== ""
        ? [
            { text: "Observaciones", style: "sectionHeader" },
            {
              text: service.observations,
              style: "observationsText",
              margin: [0, 0, 0, 10],
            },
          ]
        : null,

      service.parts && service.parts.length > 0
        ? [
            { text: "Repuestos", style: "sectionHeader" },
            {
              table: {
                widths: ["*", "auto", "auto", "auto"],
                body: [
                  ["Nombre", "Cantidad", "Precio Unitario", "Total"],
                  ...service.parts.map((part) => [
                    part.name || "No especificado",
                    part.amount,
                    formatPrice(part.price),
                    formatPrice(part.amount * part.price),
                  ]),
                ],
              },
              layout: "lightHorizontalLines",
              margin: [0, 0, 0, 10],
            },
          ]
        : null,

      service.labors && service.labors.length > 0
        ? [
            { text: "Mano de Obra", style: "sectionHeader" },
            {
              table: {
                widths: ["*", "auto", "auto", "auto"],
                body: [
                  ["Descripcin", "Cantidad", "Precio Unitario", "Total"],
                  ...service.labors.map((labor) => [
                    labor.description || "No especificado",
                    labor.amount,
                    formatPrice(labor.price),
                    formatPrice(labor.amount * labor.price),
                  ]),
                ],
              },
              layout: "lightHorizontalLines",
              margin: [0, 0, 0, 10],
            },
          ]
        : null,

      { text: "Detalles Financieros", style: "sectionHeader" },
      {
        table: {
          widths: ["*", "auto"],
          body: [
            ["N Factura:", service.invoice_number || "No especificado"],
            ["Mtodo de pago:", service.payment_method || "No especificado"],
            ["Subtotal:", { text: formatPrice(subtotal) }],
            ["IVA (13%):", { text: formatPrice(iva) }],
            [
              "Total:",
              { text: formatPrice(total), color: "green", bold: true },
            ],
          ],
        },
        layout: "lightHorizontalLines",
        margin: [0, 0, 0, 10],
      },
    ].flat(),

    styles: {
      header: {
        fontSize: 16,
        color: "#1532ba",
        bold: true,
        margin: [0, 10, 0, 5],
        alignment: "center",
      },
      subheader: {
        fontSize: 12,
        margin: [0, 0, 0, 10],
        alignment: "center",
      },
      sectionHeader: {
        fontSize: 14,
        bold: true,
        margin: [0, 10, 0, 5],
        color: "#2c3e50",
      },
      observationsText: {
        fontSize: 10,
        margin: [0, 5, 0, 10],
        background: "#f8f9fa",
        padding: [10, 5],
        border: [false, false, false, true],
        borderColor: "#dee2e6",
        borderWidth: 1,
      },
    },

    defaultStyle: {
      fontSize: 10,
    },
  };

  return {
    save: (filename) => pdfMake.createPdf(docDefinition).download(filename),
  };
};
